import React from 'react';
import './App.css';

class App extends React.Component {
  constructor (props) {
    super(props);
    this.adressOfImages = [];
    this.state = {
      imageNumber: [],
      openCloseCards: Array(12).fill(0),
    }
    this.startGame = this.startGame.bind(this);
    this.timer = this.timer.bind(this);
    this.openCloseCards = this.openCloseCards.bind(this);
  }
  // раскладка карт при нажатии кнопки "Начать игру"
  startGame () {
    let arrayOfImageNumber = [];
    for (let k = 1; k<13; k++){
      arrayOfImageNumber.push(k);
    }
    //Тасование Фишера — Йетса
    for (let i = arrayOfImageNumber.length - 1; i > 0; i--) {
      let j = Math.floor(Math.random() * (i + 1));
      [arrayOfImageNumber[i], arrayOfImageNumber[j]] = [arrayOfImageNumber[j], arrayOfImageNumber[i]];
      arrayOfImageNumber[i] = arrayOfImageNumber[i] > 6 ? arrayOfImageNumber.length + 1 - arrayOfImageNumber[i]: arrayOfImageNumber[i];
    }
    arrayOfImageNumber[0] = arrayOfImageNumber[0] > 6 ? arrayOfImageNumber.length + 1 - arrayOfImageNumber[0]: arrayOfImageNumber[0];
    // this.setState({imageNumber: arrayOfImageNumber});
    console.log(this.state.openCloseCards);
    // let imageNumber = this.state.imageNumber;
    // setTimeout (() => this.setState({imageNumber: this.state.openCloseCards}), 5000);
    // setTimeout (timer, 5000);
    //   for (let i = 0; i < this.state.imageNumber.length; i++) {
    //     this.setState(imageNumber[i]: imageNumber[i] + ' closed');
    //   }
    // }
    this.timer();
  }

  timer () {
    setTimeout ( () => {
    for (let i = 0; i < this.state.imageNumber.length; i++) {
          this.state.imageNumber[i] = this.state.imageNumber[i] + 'closed';
  }
  console.log(this.state.imageNumber);}, 5000)
}

  openCloseCards (e) {
    // let openCloseCards = this.state.openCloseCards;
    // let data = e.target.getAttribute('data');
  //   if (!openCloseCards.contains(1) &&  e.target.classList.contains('image')) {
  //   e.target.classList
  // }
  }

  render() {
    return (
      <div className="App">
        <button onClick={this.startGame}>Начать игру</button>
        <div className="block block-1" onClick={this.timer}>
          <div className={"image image" + this.state.imageNumber[0]} data="1"></div>
          <div className={"image image" + this.state.imageNumber[1]} data="2"></div>
          <div className={"image image" + this.state.imageNumber[2]} data="3"></div>
          <div className={"image image" + this.state.imageNumber[3]} data="4"></div>
        </div>
        <div className="block block-2">
          <div className={"image image" + this.state.imageNumber[4]} data="5"></div>
          <div className={"image image" + this.state.imageNumber[5]} data="6"></div>
          <div className={"image image" + this.state.imageNumber[6]} data="7"></div>
          <div className={"image image" + this.state.imageNumber[7]} data="8"></div>
        </div>
        <div className="block block-3">
          <div className={"image image" + this.state.imageNumber[8]} data="9"></div>
          <div className={"image image" + this.state.imageNumber[9]} data="10"></div>
          <div className={"image image" + this.state.imageNumber[10]} data="11"></div>
          <div className={"image image" + this.state.imageNumber[11]} data="12"></div>
        </div>
      </div>
    );
  }
}

export default App;



